#Basic workings:
# 5 banks of rotors labled A-E
#A,B,C,D have 7 rotors, E, 2
#Two key components: AB stream, EDC 'cascade'
#The AB stream consists of two rotors for each bit of the key.
#One is from the A bank and the other from the B bank.
#these rotors step forward with each character of the plaintext.
#The values of each of the seven AB pairs is XORed to give a 7-bit AB key
#The EDC cascade starts at the two E rotors, these step with every character too
#If XOR(E0,E1) = 1, all of the rotors in bank D step one place.
#If the current position on a D rotor is 1, the corresponding C rotor steps
#The value on each C rotor is XORed with te corresponding value of the AB key
#to give the complete key.
#Each key character is XORed with its corresponding plaintext character
#Encryption and decryption use the same algorithm with the same key.
#'Cam' settings on each rotor: Smallest rotor - A6, 47 positions
#                              Largest rotor - E0, 607 positions
